function make_story() {
    body.innerHTML = ""
    let story = content[Math.floor(Math.random() * content.length)];
    let title = document.createElement("h2");
    title.innerHTML = `Your Story Is: </br> ${story.Name}`

    let description = document.createElement("pre");
    description.textContent =
        `
${story.Doc != "None" ? "Doctor: " + story.Doc : "Doctorless"} 
${story.Series != "None" ? "Series: " + story.Series : ""}
${story.Date != "None" ? "Made in: " + story.Date : ""}
${story.Medium != "None" ? "Medium: " + story.Medium : ""}
`;
    body.appendChild(title);
    body.appendChild(description);
    body.appendChild(button);
}

window.addEventListener("load", make_story)
let body = document.querySelector("main");

let button = document.createElement("button");

button.setAttribute("type", "button");
button.textContent = "new story";
button.addEventListener("click", make_story)


